import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
  <BrowserRouter>  {/* Wrap your entire app in BrowserRouter */}
    <App />
  </BrowserRouter>,
  document.getElementById('root')
);
